s.aO(0,"Size Effect",new A.b6Y(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/size_effect_example.dart","    The `SizeEffect` changes the size of the component, the sizes of the\n    children will stay the same.\n    In this example you can tap the screen and the component will size up or\n    down, depending on its current state.\n  ")
