s.aO(0,"Opacity Effect",new A.b7_(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/opacity_effect_example.dart","    In this example we show how the `OpacityEffect` can be used in two ways.\n    The left Ember will constantly pulse in and out of opacity and the right\n    flame will change opacity when you click the screen.\n  ")
